function KlasorSil($dir) {
if (substr($dir, strlen($dir)-1, 1)!= '/')
$dir .= '/';
//echo $dir; //silinen klasÃ¶rÃ¼n adÄ±
if ($handle = opendir($dir)) {
 while ($obj = readdir($handle)) {
  if ($obj!= '.' && $obj!= '..') {
   if (is_dir($dir.$obj)) {
    if (!KlasorSil($dir.$obj))
     return false;
    } elseif (is_file($dir.$obj)) {
     if (!unlink($dir.$obj))
      return false;
     }
   }
 }
  closedir($handle);
  if (!@rmdir($dir))
  return false;
  return true;
 }
return false;
} 



